import "./App.css";

import { ChakraProvider } from "@chakra-ui/react";
import MyRoutes from "./MyRoutes";
import { SnackbarProvider } from "notistack";

function App() {
  return (
    <ChakraProvider>
      <SnackbarProvider maxSnack={3}>
        <MyRoutes />
      </SnackbarProvider>
    </ChakraProvider>
  );
}

export default App;
